import React, { useContext } from 'react'
import { useState } from 'react'
import navStyle from '../styles/Navibar.module.css'
import {
  Container,
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from 'reactstrap'
import AppContext from './context'

const Navibar = () => {
  const title = 'Welcome to Nextjs'
  // const { user } = useContext(AppContext)

  const [isOpen, setIsOpen] = useState(false)

  const toggle = () => setIsOpen(!isOpen)
  const user = { username: 'bob' }

  return (
    <Navbar expand='sm' className='bg-dark'>
      <NavbarBrand href='/'>reactstrap</NavbarBrand>
      <NavbarToggler onClick={toggle} />
      <Collapse isOpen={isOpen} navbar>
        <Nav className='container-fluid justify-content-end' navbar>
          <NavItem>
            <NavLink href='/' style={{ color: 'white' }}>
              Home
            </NavLink>
          </NavItem>
          <NavItem>
            {user ? (
              <h5 className='m-auto'>{user.username}</h5>
            ) : (
              <NavLink href='/register' className='inactive'>
                Sign up
              </NavLink>
            )}
          </NavItem>
          <NavItem>
            {user ? (
              <NavLink
                href='/'
                onClick={() => {
                  logout()
                  setUser(null)
                }}
              >
                Logout
              </NavLink>
            ) : (
              <NavLink href='/login'>Sign In</NavLink>
            )}
          </NavItem>
          <NavItem>
            {user ? (
              <NavLink
                href='/'
                onClick={() => {
                  logout()
                  setUser(null)
                }}
              >
                Logout
              </NavLink>
            ) : null}
          </NavItem>
        </Nav>
      </Collapse>
    </Navbar>
  )
}

export default Navibar
